ads.description:
Sprzedam Toyotę Yaris 1.4 D4D 2003r.

Samochód w pełni sprawny.



Badanie techniczne do 06.09.2026

OC - 1 miesiąc



Zadzwoń, a wszystko Ci opowiem.

Przebieg 269 tys.km.



Co zrobione:

- Nowy akumulator;

- nowy generator;

- nowa miska olejowa;

- wymienione klocki przód i tył;

- Wymiana łożyska koła tylnego prawego;

- wymieniony czujnik położenia wału korbowego;

- Zaciągnij hamulec ręczny;

- Wymienione stabilizator przód;

- wymienione przewody hamulcowe przód;

- Zamontowano podłokietnik;

- Zainstalowano nowe radio pioneer;

- dwa komplety dywaników w prezencie;

- wypolerowane reflektory;



Samochód jest już na oponach zimowych. Dorzucam w prezencie opony letnie, nowe klocki hamulcowe tył, filtr, drążek stabilizatora, zestaw naprawczy tylnego zacisku oraz inne części zamienne.



Samochód jest w idealnym stanie, wszystko działa, jest klimatyzacja, kierownica wielofunkcyjna, elektryczne lusterka, muzyka, elektryczne szyby, podgrzewane szyby.



Minusem jest rysa na prawym-lewym błotniku, ale tak kupiłem auto i nie ma to żadnego wpływu.

Dzień dobrym, mam do sprzedania samochód osobowy marki Opel Corsa wyprodukowany w 2008 roku, który został wyposażony w silnik benzynowy o pojemności 998 cm3, legitymujący się mocą 60 KM, który pokonał do tej pory 155000 km. Samochód pod względem mechanicznym w dobrym stanie, silnik odpala bez problemów ciepły czy zimny, skrzynia biegów pracuje bez zarzutu, zawieszenie pracuje prawidłowo, cicho wybiera nierówności, układ kierowniczy jest precyzyjny. Wizualnie Corsa prezentuje się jak na zdjęciach dodam, że pojazd jest używany i posiada normalne ślady wynikające z wieku i eksploatacji. Wnętrze pojazdu prezentuje się dobrze, jest czyste i zadbane, komfortu podróży dodaje wydajnie chłodząca klimatyzacja.



Opel jest wyposażenia w:

- Klimatyzacje;

- Elektryczne szyby przednie;

- Elektrycznie regulowane lusterka;

- ABS;

- Centralny zamek;

- 2 x airbag;

I wiele innych rzeczy o których zapomniałem wspomnieć.



Zapraszam wszystkie zainteresowane osoby do kontaktu telefonicznego w celu uzyskania większej ilości informacji. 



Samochód do obejrzenia w Łodzi po wcześniejszym umówieniu się.



OC ważne do 03.08.2025 roku.

Przegląd techniczny 04.04.2026 roku.
